import React from "react";
import logo from "../../assets/Logo.png";

/**
 * Navbar component
 */
const Nav = () => {
  return (
    <nav className="w-full px-4 py-2">
      <img src={logo} alt="Logo" />
    </nav>
  );
};

export default Nav;
